import { Link } from "react-router-dom";


const NavBar = ()=>{
    return (
        <>
            <Link to="/"> Home </Link>
            <Link to="/about"> Home </Link>
            <Link to="/contact">  </Link>
            <Link to="/contact/name"> Name </Link>

            <a href="/">home</a>
            <a href="/about">About</a>
            <a href="/contact">Contact</a>
            <a href="/contact/name"> Name </a> 
        </>
    )
}

export default NavBar;
